import React from 'react';
import { Table, Space, Button } from 'antd';
import { Link } from 'react-router-dom';
const CourseList = () => {
	const type = 'teacher';
	const data = [
		{
			kurs: 'cloud computing',
		},
		{
			kurs: 'bulut bilişim',
		},
	];
	const columns = [
		{
			title: 'Course',
			dataIndex: 'kurs',
		},
		{
			title: 'Actions',
			key: 'actions',
			render: () =>
				(<Link to={'/course/'}>
					<a>list exams</a>
				</Link>)(
					type === 'teacher' && (
						<Space size='middle'>
							<Link to={'/user'}>
								<a>add student</a>
							</Link>
							<Link to={'/exam'}>
								<a>create exam</a>
							</Link>
						</Space>
					)
				),
		},
	];
	return <Table dataSource={data} columns={columns} />;
};
export default CourseList;
